import mutations from "./mutations";
import getters from "./getters";
import actions from "./actions";

export default {
  namespaced: true,
  state() {
    return {
      invoices: [
        {
          id: "c1",
          items: "Maximilian",
        },
        {
          id: "c2",
          items: "Julie",
        },
        {
          id: "c2",
          items: "Julie",
        },
      ],
    };
  },
  mutations,
  getters,
  actions,
};
